<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>Document</title>

	<style type="text/css">
		
		* {
			margin: 0;
			padding: 0;
			text-decoration: none;
			outline: none;
		}

		body {
			font-size: 0;
			min-width: 900px;
			width: 100%;
		}

		.wrap {
			margin: auto;
		}

		.wrap, .drag-list {
			width: 900px;
		}

		.drag-list {
			margin-top: 20px;
			user-select: none;
			position: relative;
		}

		.item {
			height: 40px;
			width: 100%;
			cursor: pointer;
			position: absolute;
		}

		.item p {
			font-size: 22px;
			margin-left: 20px;
			display: inline-block;
		}

		.item:hover {
			background-color: #fafafa;
		}

		.item:active {
			background-color: #eeeeee;
			z-index: 99;
		}

		.vertical-align:before {
			display: inline-block;
			height: 100%;
			content: '';
			vertical-align: middle;
		}

		.vertical-align > * {
			vertical-align: middle!important;
		}

		.vertical-align > * > * {
			vertical-align: top;
		}



	</style>
